import data from './mockData'

import User from './User';

import './styles.scss'

const Users = () => (
    <main className='grid'>
        data.map(user => (`
            <div className='card'>
                <h3>${user.name}</h3>
                <p><span>ID: </span>${user.id}</p>
             </div>
        `)

        )
    </main>
)

export default Users;
